function textConvertedToUnicode(str) {
	var out = "";
	for (i = 0; i < [...str].length; i++) {
		out += parseInt("0x" + toUni([...str][i])) + ",";
	}
	return out;
}
function calculateRealLength(input) {
	return [...input].length;	
}
function toBrailleCode(input) {
	return input.split("").map(c=>brailleTable[c]).join("");
}
function toMorseCode(input) {
	return input.split("").map(c=>morseTable[c]).join("");
}
function toNatoCode(input) {
	return input.split("").map(c=>natoTable[c]).join("");
}

var t = $("#textEditorTextArea").val();
var realLength = [...t].length;


function toUnicodeNumbers(str) {
	var out = "";
	var ez = 0;
	var countr = 0;
	var ulCase = "lowercase";
	for (i = 0; i < [...str].length; i++) {
		ez = parseInt("0x" + toUni([...str][i]));
		countr++;
		ulCase = "lowercase";
		if (countr % 2 == 1) {
			ulCase = "uppercase";
		}
		out += '<span class="key' + countr + ' ' + ulCase + '" data-code="'+ ez +'">&#' + ez + ";</span>";
	}
	return out;
}
